//CREATE FIRST RLS FUNCTION
.create-or-alter function RLSFunction() {
  SecurityDemo
  | where securityemail==current_principal_details()['UserPrincipalName'];
}






























//and applied to a table
.alter table SecurityDemo policy row_level_security enable "RLSFunction()"






























