/// CHANGE THE QUERY TO USE SECURITY GROUP
.create-or-alter function RLSFunction() {
    SecurityDemo 
    | where assert(current_principal_is_member_of("aadgroup=35d05afb-f26d-40b1-a5e4-539e1b24f2c0") == true, "Computer ways no!");
}

// NOW LOOK AT THE DATA AGAIN
SecurityDemo



















