/// OPEN SLIDES....

















/// CLEAR THE CACHE
.clear cluster cache groupmembership with (group='aadgroup=35d05afb-f26d-40b1-a5e4-539e1b24f2c0')


// look at the group properties again
current_principal_is_member_of("aadgroup=35d05afb-f26d-40b1-a5e4-539e1b24f2c0");






















/// WE CAN MAKE IT MORE COMPLEX
.create-or-alter function RLSFunction() {
  let IsManager=current_principal_is_member_of("aadgroup=35d05afb-f26d-40b1-a5e4-539e1b24f2c0");
  let AllData=SecurityDemo | where IsManager;
  let PartialData=SecurityDemo | where not(IsManager) and securityemail==current_principal_details()['UserPrincipalName'];
  union AllData, PartialData
}

// NOW LOOK AT THE DATA AGAIN
SecurityDemo

















/// LOOKUP TABLES CAN ALSO BE USED
.create-or-alter function RLSFunctionWithLookup() {
  let UserToDepartmentMapping = datatable(user:string, department:string)
  [
    "bbo@probi.dk", "Tools",
    "someone@probi.dk", "Clothing"
  ];
  SecurityDemo
  | where department  in ((UserToDepartmentMapping | where user == current_principal_details()["UserPrincipalName"] | project department))
}


/// ADD IT TO THE TABLE
.alter table SecurityDemo policy row_level_security enable "RLSFunctionWithLookup()"

// SHOW THE DATA
SecurityDemo






































/// ONE SECURITY FUNCTION FOR DYNAMIC TABLES
.create-or-alter function RLSForDynamicTables(TableName: string) {
    table(TableName)
    | where securityemail==current_principal_details()['UserPrincipalName'];
}

// AND APPLIED TO THE TABLES
.alter table SecurityDemo policy row_level_security enable "RLSForDynamicTables('SecurityDemo')"

.alter table SecurityDemoTable2 policy row_level_security enable "RLSForDynamicTables('SecurityDemoTable2')"

// NOW LOOK AT THE DATA AGAIN
SecurityDemo

SecurityDemoTable2


















/// DATA MASKING FUNCTION
.create-or-alter function RLSDataMasking() {
  SecurityDemo
  | extend email = "****"
}


// ADD IT TO THE TABLE
.alter table SecurityDemo policy row_level_security enable "RLSDataMasking()"

// VIEW DATA
SecurityDemo


























/// COLUMN LEVEL SECURITY
.create-or-alter function ColumnLevelSecurity() {
  SecurityDemo
  | extend email = "****"
  | project-away securityemail
}


// ADD IT TO THE TABLE
.alter table SecurityDemo policy row_level_security enable "ColumnLevelSecurity()"
